{"enabled":true,"runs":200},"remappings":[]},"sources":{"contracts/interfaces/IPool.sol":{"content":"// SPDX-License-Identifier: GPL-2.0-or-later
pragma solidity >=0.8.4;

import "./IPositionStorage.sol";
import "./IWithdrawalMonitor.sol";

interface IPool {
    struct LiquidityPosition {
        uint256 liquidity;
        uint256 feeDebt;
        uint256 pendingFee;
        uint256 withdrawingLiquidity;
    }

    function factory() external view returns (address);

    function quoteToken() external view returns (address);

    function precision() external view returns (uint256);

    function interest() external view returns (uint256);

    function quoteReserve() external view returns (uint256);

    function quoteInDebt() external view returns (uint256);

    function withdrawingLiquidity() external view returns (uint256);

    function accFee() external view returns (uint256);

    function accProtocolFee() external view returns (uint256);

    function accFeePerShare() external view returns (uint256);

    function tradeableBaseToken(address) external view returns (bool);

    function baseReserve(address) external view returns (uint256);

    function collateralReserve(address) external view returns (uint256);

    function availableLiquidity() external view returns (uint256);

    function liquidityPosition(
        address
    )
        external
        view
        returns (
            uint256 liquidity,
            uint256 feeDebt,
            uint256 pendingFee,
            uint256 withdrawingLiquidity
        );

    function claimableFee(address) external view returns (uint256);

    function setInterest(uint256) external;

    function setBaseTokens(
        address[] memory _baseTokens,
        bool[] memory _tradeables
    ) external;

    function availLiquidity() external;

    function mint(
        address _to,
        uint256 _liquidity,
        bytes calldata _data
    ) external;

    function collect(address _to, uint256 _amount) external;

    function addBurnRequest(
        uint256 _liquidity,
        address _to,
        bytes calldata _data
    ) external returns (uint256);

    function burn(IWithdrawalMonitor.WithdrawalRequest memory) external;

    function open(
        IPositionStorage.OpenTradePositionParams memory
    ) external returns (bytes32);

    function close(IPositionStorage.CloseTradePositionParams calldata) external;

    function rollback(
        IPositionStorage.RollbackTradePositionParams memory
    ) external;

    function updateStoplossPrice(
        IPositionStorage.UpdateStoplossPriceParams memory
    ) external;

    function updateCollateralAmount(
        IPositionStorage.UpdateCollateralAmountParams memory
    ) external returns (uint256 collateralLiqPrice, uint256 baseLiqPrice);

    function updateDeadline(
        IPositionStorage.UpdateDeadlineParams memory
    ) external;
}
","keccak256":"0x874d6b40cae91f73af9ca4aefe27e6506f2b38b1a4a284007355de309d5388e6","license":"GPL-2.0-or-later"},"contracts/interfaces/IPositionStorage.sol":{"content":"// SPDX-License-Identifier: GPL-2.0-or-later
pragma solidity >=0.8.4;

interface IPositionStorage {
    struct BaseToken {
        address id;
        uint256 amount;
        uint256 entryPrice;
        uint256 liqPrice;
        uint256 closePrice;
    }
    struct QuoteToken {
        address id;
        uint256 amount;
    }
    struct Collateral {
        address id;
        uint256 amount;
        uint256 entryPrice;
        uint256 liqPrice;
        uint256 closePrice;
    }
    struct Status {
        bool isClosed;
        bool isExpired;
        bool isStoploss;
        bool isBaseLiquidated;
        bool isCollateralLiquidated;
        bool isRollbacked;
        bool isClosedManuallyStep1;
        bool isClosedManuallyStep2;
    }
    struct TradePosition {
        bytes32 positionKey;
        address owner;
        address pool;
        BaseToken baseToken;
        QuoteToken quoteToken;
        Collateral collateral;
        uint256 deadline;
        uint256 stoplossPrice;
        uint256 fee;
        uint256 protocolFee;
        Status status;
        address closer;
    }
    struct OpenTradePositionParams {
        address owner;
        address baseToken;
        address quoteToken;
        address collateral;
        uint256 baseAmount;
        uint256 quoteAmount;
        uint256 collateralAmount;
        uint256 deadline;
        uint256 stoplossPrice;
    }
    struct CloseTradePositionParams {
        bytes32 positionKey;
        bytes data0;
        bytes data1;
        address closer;
    }
    struct RollbackTradePositionParams {
        bytes32 positionKey;
        address rollbacker;
    }
    struct UpdateStoplossPriceParams {
        bytes32 positionKey;
        uint256 stoplossPrice;
        address updater;
    }
    struct UpdateCollateralAmountParams {
        bytes32 positionKey;
        uint256 amount;
        address updater;
    }
    struct UpdateDeadlineParams {
        bytes32 positionKey;
        uint256 deadline;
        address updater;
    }

    function factory() external view returns (address);

    function position(uint256) external view returns (TradePosition memory);

    function positionIndex(bytes32) external view returns (uint256);

    function positionByKey(
        bytes32
    ) external view returns (TradePosition memory);

    function openingPositionKey(uint256) external view returns (bytes32);

    function positionLength() external view returns (uint256);

    function openingPositionLength() external view returns (uint256);

    function userPositionLength(address) external view returns (uint256);

    function positionKeyByUser(
        address _user,
        uint256 _index
    ) external view returns (bytes32);

    function getMinCollateralAmount(
        OpenTradePositionParams memory
    ) external view returns (uint256);

    function getQuoteAmountRange(
        OpenTradePositionParams memory
    ) external view returns (uint256 minQuoteAmount, uint256 maxQuoteAmount);

    function previewTradePosition(
        OpenTradePositionParams memory
    ) external view returns (TradePosition memory);

    function previewUpdateCollateralAmount(
        UpdateCollateralAmountParams memory
    ) external view returns (uint256 collateralLiqPrice, uint256 baseLiqPrice);

    function previewUpdateDeadline(
        UpdateDeadlineParams memory
    ) external view returns (uint256 fee, uint256 protocolFee);

    function canLiquidate(bytes32) external view returns (bool);

    function openTradePosition(
        TradePosition memory
    ) external returns (bytes32 positionKey);

    function updateStatus(
        bytes32 _positionKey,
        address _updater
    ) external returns (bool needLiquidate);

    function rollback(bytes32 _positionKey, address _updater) external;

    function closeManuallyStep1(bytes32) external;

    function closeManuallyStep2(bytes32) external;

    function updateCloseValues(
        bytes32 _positionKey,
        uint256 _baseValue,
        uint256 _loss,
        uint256 _remainingCollateralAmount
    ) external;

    function updateStoplossPrice(UpdateStoplossPriceParams memory) external;

    function updateCollateralAmount(
        UpdateCollateralAmountParams memory
    ) external returns (uint256 collateralLiqPrice, uint256 baseLiqPrice);

    function updateDeadline(
        UpdateDeadlineParams memory
    ) external returns (uint256 fee, uint256 protocolFee);
}
